import React, { useState, useEffect } from 'react';
import axios from 'axios';

const AccountNavBar = () => {
  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <a class="navbar-brand" href="#">Finance App</a>
      <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
        <span class="navbar-toggler-icon"></span>
      </button>
      <div class="collapse navbar-collapse" id="navbarSupportedContent">
        <ul class="navbar-nav mr-auto">
          <li class="nav-item">
            <a class="nav-link" href="#">Accounts Home</a>
          </li>
          <li class="nav-item">
            <a class="nav-link" href="#">Credit</a>
          </li>
          <li class="nav-item">
            <a class="nav-link" href="#">Debit</a>
          </li>
          <li class="nav-item">
            <a class="nav-link" href="#">Loan</a>
          </li>
        </ul>
      </div>             
    </nav>
  );
};

export default function AccountList() {
    const [accounts, setAccounts] = useState([]);

    useEffect(() => {
        const userId = 1;
        axios.get(`http://localhost:8080/users/${userId}/accounts`)
        .then(response => setAccounts(response.data))
        .catch(error => console.error('There was an error fetching the accouints.', error));
    }, []);

    return (
      <AccountNavBar />
    )
}
